import React from "react";
//import styled from "styled-components";
import { Link } from "react-router-dom";

function Navigation() {
  return (
    <div className="navigationCotainer">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/AboutMe">About me</Link>
        </li>
      </ul>
    </div>
  );
}

export default Navigation;
